Wishlist Ghostbusters: Rise of the Ghost Lord now on the Meta Quest Store: https://metaque.st/42gXmcl

In this creator roundtable, Jack Bromhead, Art Director, nDreams, sat down with Travis Williams, Head of Production, Oculus Publishing, and three VR creators to discuss the new trailer for Ghostbusters: Rise of the Ghost Lord from Meta Quest Gaming Showcase 2023. Check out the conversation to hear from Jack about new gameplay, gear upgrades, and more from the epic title set to release this fall.

Featuring VR Creators:

@TechManJuVR 
@OtterWorldly 
@GAMERTAGVR 

#MetaQuestGamingShowcase

